function showBacking(uint256 accuracy) public view returns (uint256) {
    uint256 totalBacking = address(this).balance;
    uint256 totalSupply = _totalSupply;
    require(totalSupply > 0, "SafeMath: subtraction overflow");
    return totalBacking.mul(accuracy).div(totalSupply);
}

